import React from "react";

const Skills = ({ data }) => {
  if (data) {
    var technologies = data.projects.map((technology) => {
      // var projectImage = "images/portfolio/" + technology.image;
      return (
        <div key={technology.title} className="columns skills-item">
          <div className="item-wrap">
            <a href={technology.url} title={technology.title}>
              <img alt={technology.title} src={projectImage} />
              <div className="overlay">
                <div className="skills-item-meta">
                  <h5>{technology.title}</h5>
                  <p>{technology.category}</p>
                </div>
              </div>
              <div className="link-icon">
                <i className="fa fa-link"></i>
              </div>
            </a>
          </div>
        </div>
      );
    });
  }

  return (
    <section id="skills">
      <div className="row">
        <div className="twelve columns collapsed">
          <h1>Technologies I use</h1>

          <div
            id="skills-wrapper"
            className="bgrid-quarters s-bgrid-thirds cf"
          >
            {technologies}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Skills;
